import './Item.css'

const Item = (props) => {
  return (
    <div className='item'>
        <img src={prop.image} alt="" />
        <p>
            {props.name}
        </p>
        <div className="item-prices">
            <div className="item-price-new">
                {props.new_price}
            </div>
            <div className="item-prices-old">
                {props.old_price}
            </div>
        </div>
    </div>
  )
}

export default Item
